import React, {Component} from 'react';

import Menu from '../Menu';
import './header.css';

class Header extends Component {
    render(){
        return(
            <div id='header'>
                <div>
                    <img src={require('../../assets/imgs/logo-mapadareciclagem.png')} alt='logo'/>
                    <Menu />
                </div>
            </div>
        )
    }
}
export default Header;
